import React from 'react'

const BBox = ({props}) => {

    const style = {
        left: Math.floor(props.xPos) + '%',
        top: Math.floor(props.yPos) + '%',
        width: Math.floor(props.width) + '%',
        height: Math.floor(props.height) + '%'
    }
    return (
    <div className="b-box" style={style}/>
    )
}
export default BBox
